import React, { Component } from 'react';

import Snap from 'react-snap-svg'

class Test extends Component {
  componentDidMount() {
          const { children } = this.props
          if (this.svg && isFn(children)) {
              children(Snap(this.svg))
          }
      }

  render() {
    return (
      <div id="container">
        <ReactSnap>
          {(s)=>{
            s.circle(150, 150, 100)
          }}
        </ReactSnap>
      </div>
    );
  }
}

export default Test;
